{ "_id" : { "$oid" : "56666648ccf078217fce204f" }, "password" : "$2a$08$9iZo7Zp695Nooq9TWad.6.oi7nO43EnhMqAtrZ.FvbPU6RpPk.0lO", "email" : "psl58@cornell.edu", "status" : { "reimbursementGiven" : false, "checkedIn" : false, "declined" : false, "confirmed" : false, "admitted" : false, "completedProfile" : true }, "confirmation" : { "dietaryRestrictions" : [] }, "profile" : { "adult" : true, "school" : "Cornell University", "name" : "Padraig Lysandrou", "graduationYear" : "2018", "gender" : "M", "history" : "2017", "elecs" : "Advanced", "program" : "Advanced", "build" : "Intermediate", "essay" : "I would make a small hover craft by placing the fan in the hair dryer over the the aluminum can that has been cut, curled, and taped together to match the radius of the fan. Then use pieces of the toilet roll as an air skirt." }, "salt" : 1449550833903, "verified" : true, "lastUpdated" : 1453926329282, "timestamp" : 1449550833903, "admin" : false, "__v" : 0, "teamCode" : "We Choose" }
