{ "_id" : { "$oid" : "56666669ccf078217fce2055" }, "password" : "$2a$08$95H53X/WZI6JcRVYfOVd9OaGzWMEgobpH.7yrJ59WUAInOcXqyKka", "email" : "lisalu@college.harvard.edu", "status" : { "reimbursementGiven" : false, "checkedIn" : false, "declined" : false, "confirmed" : false, "admitted" : false, "completedProfile" : true }, "confirmation" : { "dietaryRestrictions" : [] }, "profile" : { "adult" : true, "build" : "Beginner", "program" : "Intermediate", "elecs" : "Intermediate", "history" : "2017", "gender" : "F", "graduationYear" : "2019", "school" : "Harvard University", "name" : "Lisa Carolyn Lu", "essay" : "I would create a small rocket. The body would be the cardboard roll and I would shred and dye toilet paper pieces orange to create streamers for \"flames.\" I'd use metal from the soda can for the outer layer, tip, tail, and fins. The hair dryer would propel the rocket." }, "salt" : 1449550833903, "verified" : true, "lastUpdated" : 1454040900943, "timestamp" : 1449550833903, "admin" : false, "__v" : 0, "teamCode" : "Team LLAMA" }
{ "_id" : { "$oid" : "5666667eccf078217fce2056" }, "password" : "$2a$08$1hOIna6mN.yyTieemOVpmOiDfNShe0Byzw6hrctQE.Zr0yrqyxPHm", "email" : "jtannady@wellesley.edu", "status" : { "reimbursementGiven" : false, "checkedIn" : false, "declined" : false, "confirmed" : false, "admitted" : false, "completedProfile" : true }, "confirmation" : { "dietaryRestrictions" : [] }, "profile" : { "essay" : "An automatic pulley system. I feel like this is better in theory than in practice, but what I'd do is remove the tab from the soda can. The tab has two holes, and it would be quite rough where it broke off the can. I'd wrap it with a bit of toilet paper to pad it. That hole will attach to a ceiling/wall/finger/stationary thing. I'd cut a tiny slit on the side of the smooth hole, and leave it as is..\n\nThen I'd cut the side (and top) of the can so that the side of the can is essentially a flat sheet. Then I'd turn the sheet into a massive hoop using this technique (http://www.businessballs.com/images/papertricks/cartrick3.jpg). Press everything down to make sure everything is pretty flat. Then insert the hoop into the smooth hole of the soda can tab where we made the slit.\n\nI'm not entirely sure what's in a hairdryer, but I imagine there's a motor attached to some paddles to make the fan in there. I'll take the hairdryer apart, remove the heating element, pad it with toilet paper, and use the fan/motor to turn my pulley system.\n\nIn case that didn't make any sense, here's a pretty awful MS Paint drawing of what I was trying to get across.\nhttp://i.imgur.com/eBVN9xo.png", "build" : "Beginner", "program" : "Intermediate", "elecs" : "Beginner", "history" : "2017", "gender" : "F", "graduationYear" : "2018", "name" : "Jesslyn Tannady", "school" : "Wellesley College", "adult" : true }, "salt" : 1449550833903, "verified" : true, "lastUpdated" : 1452046393495, "timestamp" : 1449550833903, "admin" : false, "__v" : 0 }
