{ "_id" : { "$oid" : "566666e9ccf078217fce2062" }, "password" : "$2a$08$i13ul/ZuuNoCYmASuxHzM.Kg6b0mDaHwlGWL/woSrZBFFUawUuWSa", "email" : "niyatid@mit.edu", "status" : { "reimbursementGiven" : false, "checkedIn" : false, "declined" : false, "confirmed" : false, "admitted" : true, "completedProfile" : true, "confirmBy" : 1454889600000, "admittedBy" : "admin@makemit.org" }, "confirmation" : { "dietaryRestrictions" : [] }, "profile" : { "essay" : "Clearly a rocket. Securing the can--as the rocket body, to the cardboard--rolled as a nose cone, partially empty the soda leaving space to release CO2. Temporarily seal the can and turn upside down, then heat it using the hair dryer to build pressure. When the seal’s released, you have lift-off!", "build" : "Beginner", "program" : "Intermediate", "elecs" : "Beginner", "history" : "2017", "gender" : "F", "graduationYear" : "2019", "name" : "Niyati Desai", "school" : "Massachusetts Institute of Technology", "adult" : true }, "salt" : 1449550833903, "verified" : true, "lastUpdated" : 1449871589463, "timestamp" : 1449550833903, "admin" : false, "__v" : 0, "teamCode" : "Name" }
{ "_id" : { "$oid" : "56666709ccf078217fce2063" }, "password" : "$2a$08$hCuMRlF1roNdheEVVaRZFOhJDPm21/npWvkBpyzE5oVXt0cJILsMq", "email" : "do.q@husky.neu.edu", "status" : { "reimbursementGiven" : false, "checkedIn" : false, "declined" : false, "confirmed" : false, "admitted" : false, "completedProfile" : true }, "confirmation" : { "dietaryRestrictions" : [] }, "profile" : { "essay" : "Modified the hair dryer to make it a heat gun that heats up the bottom of the soda can, and since the soda already has high enough pressure inside of it, adding heat will increase the pressure, and basically make it explode. Use the toilet paper roll to direct the exploding compressed soda at the enemy instead of having soda everywhere, by rolling it so tight that there is a small enough opening to increase pressure even more. Basically, make a super powerful one time soda gun that will piss off everyone.", "build" : "Advanced", "program" : "Advanced", "elecs" : "Advanced", "history" : "2017", "gender" : "M", "graduationYear" : "2019", "name" : "Quan Do", "school" : "Northeastern University", "adult" : true }, "salt" : 1449550833903, "verified" : true, "lastUpdated" : 1449552384979, "timestamp" : 1449550833903, "admin" : false, "__v" : 0, "teamCode" : "NopeJS" }
{ "_id" : { "$oid" : "5666672cccf078217fce2064" }, "password" : "$2a$08$0tqHvRgzOqaBZK0OQtBUBuS0BM2MJ12h6yimplFXFpDxziujT.ryK", "email" : "tiensori@mit.edu", "status" : { "reimbursementGiven" : false, "checkedIn" : false, "declined" : false, "confirmed" : false, "admitted" : false, "completedProfile" : true }, "confirmation" : { "dietaryRestrictions" : [] }, "profile" : { "essay" : "With the above item, I would make a dehydrator. The hairdryer will be deconstructed: the heating element used as a heat source and fan used to circulate heat. The toilet paper, an insulator, is wrapped around the can, a heat concentrator. They serve as the chamber to hold the food.", "build" : "Beginner", "program" : "Intermediate", "elecs" : "Beginner", "history" : "2017", "gender" : "F", "graduationYear" : "2019", "name" : "Tien Phung", "school" : "Massachusetts Institute of Technology", "adult" : true }, "salt" : 1449550833903, "verified" : true, "lastUpdated" : 1453589924986, "timestamp" : 1449550833903, "admin" : false, "__v" : 0, "teamCode" : "M6" }
