{ "_id" : { "$oid" : "566740b18700b9ca7f387fac" }, "password" : "$2a$08$UlaWjGX4qROcI781/Duouu19QLQLEFGz21v.huqW23Zh9WN0V1.Qy", "email" : "rlesh@mit.edu", "status" : { "reimbursementGiven" : false, "checkedIn" : false, "declined" : false, "confirmed" : false, "admitted" : false, "completedProfile" : true }, "confirmation" : { "dietaryRestrictions" : [] }, "profile" : { "history" : "2017", "gender" : "F", "graduationYear" : "2016", "name" : "R Robyn Lesh", "essay" : "I would make a rechargeable hand warmer. Cutting off one end of the soda can would allow the hairdryer to be fit to the opening. I'd poke a hole in the other end of the can to allow a slight bit of airflow while charging.\nIdeally I'd also add more heat holding material like additional mettle to the can to prolong it's ability to hold heat but if this isn't available it would be short charging/warming cycles.\nCharging: blowing air into/through the can to warm up the aluminium.\nWarming: holding the can to warm hands.\n*Note for very cold hands charging & warming can happen at the same time.", "build" : "Intermediate", "program" : "Intermediate", "elecs" : "Intermediate", "school" : "Massachusetts Institute of Technology", "adult" : true }, "salt" : 1449553894962, "verified" : true, "lastUpdated" : 1450040638792, "timestamp" : 1449553894962, "admin" : false, "__v" : 0 }
