{ "_id" : { "$oid" : "566748708700b9ca7f387fb1" }, "password" : "$2a$08$trWn3Lsq3RDp8HKXBKoDHeWkDRgfY5BqFR6/IT.e1YvAnvMtwoYpG", "email" : "nhung@mit.edu", "status" : { "reimbursementGiven" : false, "checkedIn" : false, "declined" : false, "confirmed" : true, "admitted" : true, "completedProfile" : true, "confirmBy" : 1454889600000, "admittedBy" : "admin@makemit.org" }, "confirmation" : { "resume" : "https://www.dropbox.com/s/ii0puc4bdcd596d/Hung_TechResume.pdf?dl=0", "signatureCodeOfConduct" : "Nancy Hung", "signaturePhotoRelease" : "Nancy Hung", "signatureLiability" : "Nancy Hung", "major" : "Electrical Engineering and Computer Science", "shirtSize" : "S", "phoneNumber" : "4089311068", "dietaryRestrictions" : [] }, "profile" : { "essay" : "I have 2 different veins of ideas:\nCreative: cut up soda can so that it can make different nozzles of different forms attach to the hair dryer. The toilet paper roll could be cut into different sizes and form a grid on top of the soda can. The resulting device could then blow dry paint, pushing droplets of watercolor or acrylic paint with water around paper. (like using hair dryer for traditional drip painting but on steroids)\n\nPractical: Use the hair dryer to heat the soda can to high enough temperature. Cut toilet paper roll such that it lays flat like a 2D surface on top of soda can to serve as insulation. The result is a grill bed for cooking or heating something.", "build" : "Beginner", "elecs" : "Beginner", "program" : "Intermediate", "history" : "2017", "gender" : "F", "graduationYear" : "2019", "name" : "Nancy Hung", "school" : "Massachusetts Institute of Technology", "adult" : true }, "salt" : 1449553894962, "verified" : true, "lastUpdated" : 1454355276754, "timestamp" : 1449553894962, "admin" : false, "__v" : 0, "teamCode" : "Lower Level Legends" }
