{ "_id" : { "$oid" : "5668ab6650b515b82cf49d1c" }, "password" : "$2a$08$engOjAcfNQSxWLILJOwPje1y..qCuoDSeIj1apcyjczmYHciYEd.m", "email" : "lauradoherty@college.harvard.edu", "status" : { "reimbursementGiven" : false, "checkedIn" : false, "declined" : false, "confirmed" : false, "admitted" : false, "completedProfile" : true }, "confirmation" : { "dietaryRestrictions" : [] }, "profile" : { "essay" : "I would create a mini survival kit with. Many common hair dryers have a few important parts when taken apart: fan blades, heating elements, and screens. Since aluminum has an extremely high melting point, I would cut the soda can to resemble a cup and use that to hold things that need to be heated. Then I would build a contraption of the casing of the hair dryer and the heating elements to heat up substances inside of the cup. The paper towel tube would be used to prevent burning from heat while holding the can.", "build" : "Intermediate", "program" : "Intermediate", "elecs" : "Intermediate", "history" : "2017", "gender" : "F", "graduationYear" : "2019", "name" : "Laura Doherty", "school" : "Harvard University", "adult" : true }, "salt" : 1449699595228, "verified" : true, "lastUpdated" : 1453841878938, "timestamp" : 1449699595228, "admin" : false, "__v" : 0, "teamCode" : "The MakeShifts" }
