{ "_id" : { "$oid" : "56787e1850b515b82cf49db6" }, "password" : "$2a$08$.HVPizUXvG3tR2bZ0Osz0O/.OHHQh2TkZX33g3S7Al/ZUSM69WskC", "email" : "hlove@mit.edu", "status" : { "reimbursementGiven" : false, "checkedIn" : false, "declined" : false, "confirmed" : false, "admitted" : true, "completedProfile" : true, "confirmBy" : 1454889600000, "admittedBy" : "team@makemit.org" }, "confirmation" : { "dietaryRestrictions" : [] }, "profile" : { "essay" : "A rotisserie grill!  I'd use the motor in the hair dryer to rotate the feast (maybe using a gearbox to lower rpm and increase torque), and I would use the high resistance filaments in the dryer as my source of heat.   There are two options with the soda can - assuming its full, I've got myself a drink.  Otherwise, I cut it open and I use it as an oil pan to catch the dripping juices that flow off the cooking meat.  I use the toilet paper roll as napkins.", "build" : "Intermediate", "program" : "Intermediate", "elecs" : "Intermediate", "history" : "2017", "gender" : "M", "graduationYear" : "2018", "name" : "Henry Love", "school" : "Massachusetts Institute of Technology", "adult" : true }, "salt" : 1449699595228, "verified" : true, "lastUpdated" : 1454007820017, "timestamp" : 1449699595228, "admin" : false, "__v" : 0, "teamCode" : "Knights of the Round Table" }
{ "_id" : { "$oid" : "567890a750b515b82cf49db7" }, "password" : "$2a$08$DKFK40oJAMMXgEKvP6i4C..SbAz3y4FyYMRPuSv6GjiAI1mjPxS3S", "email" : "melodyt@andrew.cmu.edu", "status" : { "reimbursementGiven" : false, "checkedIn" : false, "declined" : false, "confirmed" : false, "admitted" : true, "completedProfile" : true, "confirmBy" : 1454889600000, "admittedBy" : "admin@makemit.org" }, "confirmation" : { "dietaryRestrictions" : [] }, "profile" : { "history" : "2017", "gender" : "F", "graduationYear" : "2018", "device" : "can't afford to dissect my mom's hairdryer sorry :(", "essay" : "Heated Drink Holder\n\nFirst, I'd cut off the top of the soda can, leaving the body and bottom. After removing the fan from the hairdryer and heated coils, I wrap the coils around the soda can, leaving circuitry intact, and reinsert into the barrel of the dryer with the cord emerging from the tapered (opposite) end. I wrap the top of the gutted can around the rim of the barrel where it emerges, wrapping the rounded rim of the removed top back over the edge, and cut the toilet paper roll vertically in half to wrap around the barrel and serve as a sleeve.", "build" : "Beginner", "program" : "Advanced", "elecs" : "Intermediate", "name" : "Melody Ting", "school" : "Carnegie Mellon University", "adult" : true }, "salt" : 1449699595228, "verified" : true, "lastUpdated" : 1451277892503, "timestamp" : 1449699595228, "admin" : false, "__v" : 0, "teamCode" : "Scotties" }
