{ "_id" : { "$oid" : "567ca6ae50b515b82cf49dcf" }, "password" : "$2a$08$//aET.bU45QfHYI/Vi9Qk.2NoPr1kMwBRgoixwPOWU3oR3hVtWqhW", "email" : "kanika.dutta@uwaterloo.ca", "status" : { "reimbursementGiven" : false, "checkedIn" : false, "declined" : false, "confirmed" : false, "admitted" : false, "completedProfile" : true }, "confirmation" : { "dietaryRestrictions" : [] }, "profile" : { "device" : "https://www.dropbox.com/s/xk2szcy53ub7s22/kanika_makemit.jpg?dl=0", "build" : "Intermediate", "program" : "Intermediate", "elecs" : "Beginner", "history" : "2017", "name" : "Kanika Dutta", "school" : "University of Waterloo", "gender" : "F", "graduationYear" : "2019", "essay" : "I would make a humidifier/air freshener.   I would squeeze and dip the toilet paper roll and insert it into the can with 2-3inches protruding out.  The next step would be to fill the can up with water.  Then I would blow air onto the can using the blow drying and through the process of capillarity the diffused water would then have the ability to humidify the area.   For further benefits, adding a little air freshener into the water would add fragrance to the area which is a positive externality of consumption.", "adult" : true }, "salt" : 1449699595228, "verified" : true, "lastUpdated" : 1453765683905, "timestamp" : 1449699595228, "admin" : false, "__v" : 0, "teamCode" : "MITwat" }
