{ "_id" : { "$oid" : "56872e4450b515b82cf49e15" }, "password" : "$2a$08$dFtNK8gWqn3ncvSROaJaW.2rOLa8HIJAWBGDS4Oq1PwiY6EY5TU4i", "email" : "yan25y@mtholyoke.edu", "status" : { "reimbursementGiven" : false, "checkedIn" : false, "declined" : false, "confirmed" : false, "admitted" : false, "completedProfile" : true }, "confirmation" : { "dietaryRestrictions" : [] }, "profile" : { "device" : "https://www.dropbox.com/s/i8fe9wuivslhu23/WP_20160106_001.mp4?dl=0", "essay" : "It happened to me many times that in a small bathroom without a fan, the bathroom got so damp after shower that I can't see myself in mirror and can't blow dry my hair because the air is saturated with water vapor. This inspired me to transform a hair dryer into a dehumidifier. The hair dryer itself remains intact, with a small electronic unit is added onto it. The unit contains a fan that sucks in the air, which is passed through two layers of water absorbing material contained in a soda can. The soda can is attached to the hair dryer end, so that the air can be passed through the hair dryer and become warm and dry.", "build" : "Beginner", "program" : "Intermediate", "elecs" : "Intermediate", "history" : "2017", "gender" : "F", "graduationYear" : "2017", "name" : "Yan Yan", "school" : "Mount Holyoke College", "adult" : true }, "salt" : 1449699595228, "verified" : true, "lastUpdated" : 1452058177591, "timestamp" : 1449699595228, "admin" : false, "__v" : 0 }
