{ "_id" : { "$oid" : "569aff3350b515b82cf49f08" }, "password" : "$2a$08$OWGyb.AcYCdTelJRjc5c4.ToREMrJEMIp3rWFssoSSVQmN.0sVIsa", "email" : "rahv7245@mit.edu", "status" : { "reimbursementGiven" : false, "checkedIn" : false, "declined" : false, "confirmed" : false, "admitted" : false, "completedProfile" : true }, "confirmation" : { "dietaryRestrictions" : [] }, "profile" : { "essay" : "I'd cut out the top and bottom of the soda can, attach it to the hair dryer, and use it to launch toilet paper rolls.", "build" : "Beginner", "program" : "Intermediate", "elecs" : "Beginner", "history" : "2017", "gender" : "M", "graduationYear" : "2019", "name" : "Rockey Hester", "school" : "Massachusetts Institute of Technology", "adult" : true }, "salt" : 1449699595228, "verified" : true, "lastUpdated" : 1452998876846, "timestamp" : 1449699595228, "admin" : false, "__v" : 0, "teamCode" : "Rocket boys" }
