{ "_id" : { "$oid" : "569b199450b515b82cf49f0a" }, "password" : "$2a$08$pepa8b9Gx5ByGZRUuZloAuaP8zBPIn/Wo.WuAqPxQDaDwVQZwdfUG", "email" : "shreya.subramaniam@uwaterloo.ca", "status" : { "reimbursementGiven" : false, "checkedIn" : false, "declined" : false, "confirmed" : false, "admitted" : false, "completedProfile" : true }, "confirmation" : { "dietaryRestrictions" : [] }, "profile" : { "essay" : "Given these three materials, I would create a s'mores maker! S'mores are a fun camping snack comprised of a slice of chocolate and a marshmallow sandwiched between two biscuits. Usually, the marshmallows in s'mores are roasted over a campfire. However, a delicious twist on this recipe would be if we heated the entire s'more before eating it, so the chocolate melted into the marshmallow and the biscuits were nice and warm. I would cut off the top of the soda can and place the s'more inside it. Then, I would wrap the toilet paper around the top of the can to prevent heat loss. Finally, I would use the hair dryer to heat up the soda can, in turn heating up the s'more!", "build" : "Intermediate", "program" : "Advanced", "elecs" : "Intermediate", "history" : "2017", "gender" : "F", "graduationYear" : "2019", "school" : "University of Waterloo", "name" : "Shreya Subramaniam", "adult" : true }, "salt" : 1449699595228, "verified" : true, "lastUpdated" : 1454107455956, "timestamp" : 1449699595228, "admin" : false, "__v" : 0 }
