{ "_id" : { "$oid" : "56a63ae450b515b82cf49ff0" }, "password" : "$2a$08$w6VKcbr94vJ5Gqn93nsNcOyZfaRT6AxB3/ykmkT6cjanX1dQ0q0s.", "email" : "zeping.sun@mail.utoronto.ca", "status" : { "reimbursementGiven" : false, "checkedIn" : false, "declined" : false, "confirmed" : false, "admitted" : false, "completedProfile" : true }, "confirmation" : { "dietaryRestrictions" : [] }, "profile" : { "essay" : "First, I will cut open the soda can so that I now have a flat sheet of aluminium instead of the can. Then, I would plug in the hair dryer and direct its stream of hot air onto the sheet of aluminium, heating it up to be even more malleable. I then remove some toilet paper from the roll and wrap my hands in it. Now with shielded hands, I proceed with shaping the (hot) malleable sheet into a toilet paper roll holder. Finally, I finish it off by inserting the holder into the roll to test my design. And voila, a non-corrosive toilet paper holder. Sorry about the word limit", "build" : "Advanced", "program" : "Beginner", "elecs" : "Beginner", "history" : "2017", "gender" : "M", "graduationYear" : "2018", "school" : "University of Toronto", "name" : "Zeping Sun", "adult" : true }, "salt" : 1449699595228, "verified" : true, "lastUpdated" : 1453868898611, "timestamp" : 1449699595228, "admin" : false, "__v" : 0, "teamCode" : "The 6ix" }
{ "_id" : { "$oid" : "56a643e650b515b82cf49ff1" }, "password" : "$2a$08$INX.rflo8NwXd9ssX7pKE.bJIx7KIs82XiqSbM/5p57trIHSw1Pxy", "email" : "cecilwilliams@college.harvard.edu", "status" : { "reimbursementGiven" : false, "checkedIn" : false, "declined" : false, "confirmed" : false, "admitted" : false, "completedProfile" : true }, "confirmation" : { "dietaryRestrictions" : [] }, "profile" : { "essay" : "I would make a heat activated  toilet paper dispenser. No one likes seeing wasted toilet paper or an unraveled roll that has probably touched the floor or someone else's hands. The dispenser would be activate by two body heat sensors on opposite rims of the toilet seat. Paper comes out when you sit down, then only comes out again once you've tilted to wipe and placed your other cheek back on the toilet seat. I would line the seat with aluminum from the soda can and reverse engineer the hair dryer to turn heat energy to electric potential instead of the other way around. I'd use parts from the hair dryer as casing for the toilet paper.", "name" : "Cecil Williams II", "graduationYear" : "2019", "gender" : "M", "history" : "2017", "build" : "Beginner", "program" : "Beginner", "elecs" : "Beginner", "school" : "Harvard University", "adult" : true }, "salt" : 1449699595228, "verified" : true, "lastUpdated" : 1453738258256, "timestamp" : 1449699595228, "admin" : false, "__v" : 0 }
