{ "_id" : { "$oid" : "56aaee015d566e6f062974ec" }, "password" : "$2a$08$ySbcdz7riPjUyP7NFnZK3O6B3UO1aEZ1MEjuiscwJJs5CxhowdgmS", "email" : "dcarball@mit.edu", "status" : { "reimbursementGiven" : false, "checkedIn" : false, "declined" : false, "confirmed" : false, "admitted" : false, "completedProfile" : true }, "confirmation" : { "dietaryRestrictions" : [] }, "profile" : { "essay" : "A toilet paper gun! \n\nI'd use the soda can to make an axle suspended from the nose of the hair dryer and set the toilet paper roll on the axle. When the hair dryer is turned on, the air would blow the end of the toilet paper roll and it would unravel across the room!\n\nThis would be very useful for cleaning up large messes quickly, and could easily be turned into a flame thrower with the addition of a lighter.", "name" : "Daniel Carballo", "build" : "Advanced", "program" : "Intermediate", "elecs" : "Intermediate", "history" : "2017", "gender" : "M", "graduationYear" : "2018", "school" : "Massachusetts Institute of Technology", "adult" : true }, "salt" : 1454023817524, "verified" : true, "lastUpdated" : 1454043354677, "timestamp" : 1454023817524, "admin" : false, "__v" : 0, "teamCode" : "Shake 'n Make" }
