{ "_id" : { "$oid" : "56ab68045d566e6f062974fc" }, "password" : "$2a$08$DmIr6q/NKB7j68l/D4zRJujC.M/mZCtHJwuy0uV8S6hpAopdg2nQK", "email" : "dawer.jamshed1@dc.edu", "status" : { "reimbursementGiven" : false, "checkedIn" : false, "declined" : false, "confirmed" : false, "admitted" : false, "completedProfile" : true }, "confirmation" : { "dietaryRestrictions" : [] }, "profile" : { "adult" : true, "name" : "Dawer Jamshed", "school" : "Dominican College of Blauvelt", "graduationYear" : "2016", "gender" : "M", "history" : "2017", "elecs" : "Intermediate", "program" : "Intermediate", "build" : "Intermediate", "essay" : "I would first remove the fan and motor from the hair dryer. Depending on the size of the components, I would house them in either can or roll and use the remaining cylinder to direct airflow and keep the fan facing the ground in order generate lift for the monocopter." }, "salt" : 1454023817524, "verified" : true, "lastUpdated" : 1454077929167, "timestamp" : 1454023817524, "admin" : false, "__v" : 0, "teamCode" : "Black Tea" }
{ "_id" : { "$oid" : "56ab77d95d566e6f062974fd" }, "password" : "$2a$08$XcQ5bVZqgsLRk4vYGsIabuDYQHMpTlp97W0yUhD4f6n2tyOdj/oiq", "email" : "dnj26@drexel.edu", "status" : { "reimbursementGiven" : false, "checkedIn" : false, "declined" : false, "confirmed" : false, "admitted" : false, "completedProfile" : true }, "confirmation" : { "dietaryRestrictions" : [] }, "profile" : { "essay" : "Cut the can in half (length) and attach the hairdryer motor to one end. The remaining can piece would be rolled into a \"mini-cannon\" via the heating coil. A paper ball would be stuffed into the mini-cannon and \"fired\" out via rapid heating. Two words..... Battle Boats.", "build" : "Intermediate", "program" : "Beginner", "elecs" : "Intermediate", "history" : "2017", "gender" : "M", "graduationYear" : "2018", "name" : "David N Juboor", "school" : "Drexel University", "adult" : true }, "salt" : 1454023817524, "verified" : true, "lastUpdated" : 1454079231675, "timestamp" : 1454023817524, "admin" : false, "__v" : 0, "teamCode" : "Black Tea" }
{ "_id" : { "$oid" : "56ab7ef95d566e6f062974fe" }, "password" : "$2a$08$0g420xkjA9H0UG.SZDdSVuRqw7p6Z4E0u3DCjYaXHqEyr50LpvVHS", "email" : "gdc9@duke.edu", "status" : { "reimbursementGiven" : false, "checkedIn" : false, "declined" : false, "confirmed" : false, "admitted" : false, "completedProfile" : true }, "confirmation" : { "dietaryRestrictions" : [] }, "profile" : { "adult" : true, "school" : "Duke University", "name" : "Gerry Chen", "graduationYear" : "2019", "gender" : "M", "history" : "2017", "elecs" : "Intermediate", "program" : "Advanced", "build" : "Intermediate", "essay" : "A food warmer - dissect the soda can to make a bowl type shape and set it on top of the toilet paper roll which fits over the hair dryer.  Cut some holes/slits towards the top of the toilet paper roll and turn on the hair dryer to keep your soup warm (which you put in the soda can).  Some finesse will be needed to bend the aluminum in such a shape to have little prongs that can be used to keep it on the TP roll as well as some extra scraps to fasten the roll to the hair dryer." }, "salt" : 1454023817524, "verified" : true, "lastUpdated" : 1454113396647, "timestamp" : 1454023817524, "admin" : false, "__v" : 0, "teamCode" : "olin" }
